import React, {useState } from 'react'
import './App.css';

function App() {
  /**const handleChange = (e) => {
    this.setState({selectedValue: e.target.value})
    var x,y,z, D, k;
    x = document.getElementById('length').value;
    console.log(x);
    y = document.getElementById('width').value;
    z = document.getElementById('height').value;
    D = document.getElementById('measurement').value; //can be event.target.value
    if(D === "centi"){
      k = x*y*z;
     document.getElementById('vol').value = k
    }
  }
  **/
  const [length, setLength] = useState(0);
  const [width, setWidth] = useState(0);
  const [height, setHeight] = useState(0);
  const [cubicVolume, setCubicVolume] = useState(length * width * height);
  const [OptionValue, setOptionValue] = useState("");
  const [quantity, setQuantity] = useState(1);
  const [cubicFeet, setCubicFeet] = useState(0);


  const handleSelection = (e) => {
    reset();
    console.log(e.target.value);
    var a = e.target.value;
    setOptionValue(a);


  }
  const reset = () => {
    setHeight(0);
    setLength(0);
    setWidth(0);
    setCubicVolume(0);
    setOptionValue("");

  }

  const styling = {
    width: '30%',
    padding: '12px' ,
    margin: '8px' ,
    boxSize: 'border-box',
    align: 'center'
  }

  const calculate = () => {
    if (OptionValue === "mili") {

      setCubicVolume(0.001 * 0.001 * 0.001 * quantity * length * width * height);  // check for the previous option value
      console.log("Cubic Volume mili "+cubicVolume);
      setCubicFeet(Math.round(0.0032*0.0032*0.0032 * quantity* length * width * height));

    }
    if (OptionValue === "centi") {

      setCubicVolume(0.01 * 0.01 * 0.01 * quantity* length * width * height);
      console.log("Cubic Volume centi "+cubicVolume);
      setCubicFeet(Math.round(0.032 * 0.032 * 0.032 * quantity* length * width * height));

    }
    if (OptionValue === "meter") {
      //console.log(OptionValue)
      setCubicVolume(quantity * length * width * height);
      console.log("Cubic Volume meter "+cubicVolume);
      setCubicFeet(Math.round(3.281*3.281*3.281*quantity * length * width * height));

    }

  }


  return (
    <div className="App">
    <label>Unit of measurement</label>
    <select style= {styling} value = {OptionValue} onChange= { e => {handleSelection(e); calculate()} } >
    <option value = "" disabled>Select value</option>
     <option value = "centi">cm</option>
     <option value = "mili">mm</option>
     <option value = "meter">meter</option>
    </select>


      <br></br>
      <label>Length </label>
      <input type="number" style = {styling} value={length} onChange={e => setLength(+e.target.value)} onKeyUp = { () => calculate()}/>
      <br></br>
      <label>Width </label>
      <input type="number" style = {styling} value={width} onChange={e => setWidth(+e.target.value)} onKeyUp = { () => calculate()}/>
      <br></br>
      <label>Height </label>
      <input type="number" style = {styling} value={height} onChange={e => setHeight(+e.target.value)} onKeyUp = { () => calculate()}/>
      <br>
      </br>
      <label>Quantity</label>
      <input type="number" style = {styling} value={quantity} onChange={e => setQuantity(+e.target.value)} onKeyUp = { () => calculate()}/>
      <br></br>
      <label> Volume (Cubic Meter) </label>
      <input type="number" style = {styling} value={cubicVolume} readOnly={true} />
      <br>
      </br>
      <label> Volume (Cubic Feet) </label>
      <input type="number" style = {styling} value={cubicFeet} readOnly={true} />
      <br>
      </br>
      <button style = {styling} onClick={reset}>Reset</button>


    </div>
  );
}

export default App;
